
class Solution:
    def addStrings(self, num1: str, num2: str) -> str:
        length1 = len(num1)
        length2 = len(num2)
        maxLength = length1
        if length2 > length1:
            maxLength = length2
        need_carry = False
        target = ''
        for i in range(0,maxLength):
            if length1 - i > 0:
                n1 = num1[length1 - i - 1]
            else:
                n1 = '0'
            if length2 - i > 0:
                n2 = num2[length2 - i - 1]
            else:
                n2 = '0'
            sum = (ord(n1) - ord('0')) + (ord(n2) - ord('0'))
            if need_carry:
                sum += 1
                need_carry = False
            if sum > 9:
                need_carry = True
                sum = sum - 10
            target = f'{sum}{target}'
        if need_carry:
            target = f'1{target}'

        return target

if __name__ == '__main__':
    solution = Solution()
    case1 = [
        # ("11","123"),
        # ("456","77"),
        # ("0","0"),
        ("1",
         ""
         )
    ]
    case2 = [
        # "134",
        # "533",
        # "0",
        "2"
    ]
    res = []
    for i in range(len(case1)):
        r = solution.addStrings(case1[i][0],case1[i][1])
        print(f'expect: {case2[i]}, res: {r}')
        res.append(r)
    print(res)

'''
给定两个字符串形式的非负整数 num1 和num2 ，计算它们的和并同样以字符串形式返回。

你不能使用任何內建的用于处理大整数的库（比如 BigInteger）， 也不能直接将输入的字符串转换为整数形式。

 

示例 1：

输入：num1 = "11", num2 = "123"
输出："134"
示例 2：

输入：num1 = "456", num2 = "77"
输出："533"
示例 3：

输入：num1 = "0", num2 = "0"
输出："0"
 

 

提示：

1 <= num1.length, num2.length <= 104
num1 和num2 都只包含数字 0-9
num1 和num2 都不包含任何前导零
'''